import React,{useState, useEffect} from 'react';
import SearchIcon from '@material-ui/icons/Search';
import './Search.css';
import SpotifyWebApi from 'spotify-web-api-js';
import SongRow from './SongRow';
import Footer from './Footer';
import MenuIcon from '@material-ui/icons/Menu';

const Search = ({sideBar, setSideBar, smallScreen}) => {

    const spotify = new SpotifyWebApi();

    const [search, setSearch] = useState('');
    const [searchResults, setSearchResults] = useState([]);
    const [playingTrack, setPlayingTrack] = useState();

    function chooseTrack(track){
        setPlayingTrack(track)
        setSearch('');
    }

    useEffect(()=>{
        if(!search) return
        let cancel = false;
        spotify.searchTracks(search).then(res => {
                if(cancel) return
            setSearchResults( res.tracks.items.map(track => track) )    
            })
      return () => cancel=true;
    },[search]);


    return (
        <div className={smallScreen?"SearchBack active":"SearchBack"}>
            <div className="top">
            {!sideBar?<MenuIcon onClick={()=>setSideBar(!sideBar)}/>:''}
            <div className="header_left">
                <SearchIcon />
                <input onChange={(e)=>setSearch(e.target.value)} placeholder="Search for Artists, Songs, Podcasts" type="text" />
            </div>
            </div>

            <div className="searchSongs">
                {
                    searchResults.map(track => (
                        <SongRow track={track} chooseTrack={chooseTrack}/>
                    ))
                }
            </div>

            <h3>Top Results</h3>
    <div class="card-container">
      <div class="search-card">
        <img src="album-cover.jpg" alt="Album Cover"/>
        <div class="search-card-info">
          <h3 class="search-card-title">Album Title</h3>
          <p class="search-card-subtitle">Artist Name</p>
        </div>
      </div>
      <div class="search-card">
        <img src="playlist-cover.jpg" alt="Playlist Cover"/>
        <div class="search-card-info">
          <h3 class="search-card-title">Playlist Title</h3>
          <p class="search-card-subtitle">Curator Name</p>
        </div>
      </div>
      <div class="search-card">
        <img src="podcast-cover.jpg" alt="Podcast Cover"/>
        <div class="search-card-info">
          <h3 class="search-card-title">Podcast Title</h3>
          <p class="search-card-subtitle">Host Name</p>
        </div>
      </div>
    </div>

    <h3>Albums</h3>
    <div class="card-container">
      <div class="search-card">
        <img src="album-cover.jpg" alt="Album Cover"/>
        <div class="search-card-info">
          <h3 class="search-card-title">Album Title</h3>
          <p class="search-card-subtitle">Artist Name</p>
        </div>
      </div>

      </div>


            <Footer trackUri={playingTrack?.uri}/>
        </div>

    )
}

export default Search
